export default function SearchBar({onSearch}) { 
   return (
      <div className={style.bar}>
          <input type="search" className={style.searchInput} />
      <button onClick={(id) => {onSearch(id)}} className={style.searchButton}>Agregar</button> 
      </div>
   );
}

